css:
atom-text-editor,
:host {
  background-color: #25292a;
  color: #b0b0b0;
  /* Linting */
}
atom-text-editor .wrap-guide,
:host .wrap-guide {
  background-color: rgba(255, 255, 255, 0.1);
}
atom-text-editor .indent-guide,
:host .indent-guide {
  color: rgba(255, 255, 255, 0.1);
}
atom-text-editor .invisible-character,
:host .invisible-character {
  color: #b0b0b0;
}
atom-text-editor .gutter,
:host .gutter {
  background-color: #25292a;
  color: #ffffff;
}
atom-text-editor .gutter .line-number,
:host .gutter .line-number {
  color: #b0b0b0;
}
atom-text-editor .gutter .line-number.cursor-line,
:host .gutter .line-number.cursor-line {
  background-color: rgba(255, 255, 255, 0.1);
  color: #ffffff;
}
atom-text-editor .gutter .line-number.cursor-line-no-selection,
:host .gutter .line-number.cursor-line-no-selection {
  color: #ffffff;
}
atom-text-editor .gutter .line-number.folded,
:host .gutter .line-number.folded,
atom-text-editor .gutter .line-number:after,
:host .gutter .line-number:after,
atom-text-editor .fold-marker:after,
:host .fold-marker:after {
  color: #b0b0b0;
}
atom-text-editor .gutter .line-number.linter-error .icon-right:before,
:host .gutter .line-number.linter-error .icon-right:before {
  color: #F9614A;
}
atom-text-editor .gutter .line-number.linter-warning .icon-right:before,
:host .gutter .line-number.linter-warning .icon-right:before {
  color: #FFB05A;
}
atom-text-editor .invisible,
:host .invisible {
  color: #b0b0b0;
}
atom-text-editor .cursor,
:host .cursor {
  color: #d74154;
}
atom-text-editor .selection .region,
:host .selection .region {
  background-color: rgba(215, 65, 84, 0.45);
}
atom-text-editor .search-results .marker .region,
:host .search-results .marker .region {
  background-color: transparent;
  border: 1px solid #b0b0b0;
}
atom-text-editor .search-results .marker.current-result .region,
:host .search-results .marker.current-result .region {
  border: 1px solid #ffffff;
}
.comment {
  color: #405a69;
}
.entity {
  color: #cccccc;
}
.entity.name.type {
  color: #9e9e9e;
  text-decoration: underline;
}
.entity.other.inherited-class {
  color: #9e9e9e;
}
.keyword {
  color: #cccccc;
}
.keyword.control {
  color: #cccccc;
}
.keyword.operator {
  color: #b0b0b0;
}
.keyword.other.special-method {
  color: #77acc5;
}
.keyword.other.unit {
  color: #77acc5;
}
.storage {
  color: #77acc5;
}
.constant {
  color: #77acc5;
}
.constant.character.escape {
  color: #77acc5;
}
.constant.numeric {
  color: #77acc5;
}
.constant.other.color {
  color: #77acc5;
}
.constant.other.symbol {
  color: #77acc5;
}
.variable {
  color: #7483d2;
}
.variable.interpolation {
  color: #a43240;
}
.variable.parameter.function {
  color: #b0b0b0;
}
.invalid.illegal {
  background-color: #d74154;
  color: #25292a;
}
.string {
  color: #77acc5;
}
.string.regexp {
  color: #77acc5;
}
.string.regexp .source.ruby.embedded {
  color: #77acc5;
}
.string.other.link {
  color: #d74154;
}
.punctuation.definition.comment {
  color: #405a69;
}
.punctuation.definition.string,
.punctuation.definition.variable,
.punctuation.definition.parameters,
.punctuation.definition.array {
  color: #b0b0b0;
}
.punctuation.definition.heading,
.punctuation.definition.identity {
  color: #77acc5;
}
.punctuation.definition.bold {
  color: #77acc5;
  font-weight: bold;
}
.punctuation.definition.italic {
  color: #77acc5;
  font-style: italic;
}
.punctuation.section.embedded {
  color: #a43240;
}
.support.class {
  color: #5ca695;
}
.support.function {
  color: #77acc5;
}
.support.function.any-method {
  color: #77acc5;
}
.entity.name.function {
  color: #77acc5;
}
.entity.name.class,
.entity.name.type.class {
  color: #77acc5;
}
.entity.name.section {
  color: #77acc5;
}
.entity.name.tag {
  color: #587f92;
}
.entity.other.attribute-name {
  color: #cccccc;
}
.entity.other.attribute-name.id {
  color: #77acc5;
}
.meta.class {
  color: #77acc5;
}
.meta.link {
  color: #77acc5;
}
.meta.require {
  color: #77acc5;
}
.meta.selector {
  color: #77acc5;
}
.meta.separator {
  background-color: #b0b0b0;
  color: #b0b0b0;
}
.none {
  color: #b0b0b0;
}
.markup.bold {
  color: #77acc5;
  font-weight: bold;
}
.markup.changed {
  color: #77acc5;
}
.markup.deleted {
  color: #d74154;
}
.markup.italic {
  color: #77acc5;
  font-style: italic;
}
.markup.heading .punctuation.definition.heading {
  color: #77acc5;
}
.markup.inserted {
  color: #42a690;
}
.markup.list {
  color: #d74154;
}
.markup.quote {
  color: #77acc5;
}
.markup.raw.inline {
  color: #42a690;
}
.bracket-matcher .region {
  border-bottom: solid 2px #ffffff;
  margin-top: .5px;
  opacity: 0.7;
}
.source.gfm .markup {
  -webkit-font-smoothing: auto;
}
.source.gfm .markup.heading {
  color: #42a690;
}
atom-text-editor[mini] .scroll-view,
:host([mini]) .scroll-view {
  padding-left: 1px;
}
